import React from "react";

function table(props) {
  return (
      <table className="text-center">
        <thead>

          <tr>
              <th>Image</th>
              <th>
                  <button onClick={props.onNameClick}></button>
              </th>
              <th>Email</th>
              <th>Phone</th>
              <th>Country</th>
          </tr>
        </thead>
          {/* <tr>
              <td>
                  {" "}
                  <img
                      alt={props.title}
                      className="img-fluid"
                      src={props.src}
                      style={{ margin: "0 auto" }}
                  />
              </td>
              <td> {props.name}</td>
              <td> {props.email}</td>
              <td> {props.phone} </td>
              <td> {props.country}</td>
          </tr> */}

          {props.filteredContacts.map(item => (
              <tr key={item.login.uuid}>
                  <td>
                      <img src={item.picture.thumbnail} alt="" />
                  </td>
                  <td>{item.name.first + " " + item.name.last}</td>
                  <td>{item.email}</td>
                  <td>{item.phone}</td>
                  <td>{item.nat}</td>
              </tr>
          ))}
      </table>
  );
}

export default table;
